import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams, useNavigate } from 'react-router-dom';
import Modal from './Modal';

const VillaDetail = () => {
  const { villaId } = useParams();
  const navigate = useNavigate();
  const [villaData, setVillaData] = useState(null);
  const [selectedSpace, setSelectedSpace] = useState(null);
  const [currentUser, setCurrentUser] = useState(null);
  const [modalOpen, setModalOpen] = useState(false);
  const [exitTime, setExitTime] = useState('');
  const [notes, setNotes] = useState('');

  useEffect(() => {
    const fetchVilla = async () => {
      try {
        const response = await axios.get(`http://localhost:3001/api/villa/${villaId}`, { withCredentials: true });
        setVillaData(response.data);
      } catch (error) {
        console.error('Error fetching villa details:', error);
      }
    };

    const fetchCurrentUser = async () => {
      try {
        const response = await axios.get('http://localhost:3001/api/user/current', { withCredentials: true });
        setCurrentUser(response.data);
      } catch (error) {
        console.error('Error fetching current user:', error);
      }
    };

    fetchVilla();
    fetchCurrentUser();
  }, [villaId]);

  const openModal = (space) => {
    setSelectedSpace(space);
    setModalOpen(true);
  };

  const closeModal = () => {
    setSelectedSpace(null);
    setModalOpen(false);
  };

  const handleSubmit = async (details) => {
    if (!selectedSpace || !currentUser) {
      console.log('No space or user selected');
      return;
    }

    try {
      const response = await axios.post(
        `http://localhost:3001/api/villa/${villaId}/update-space/${selectedSpace._id}`,
        {
          ...details,
          isOccupied: true,
          userId: currentUser._id,
        }
      );
      console.log('Updated space data:', response.data);
      setVillaData((prevVillaData) => ({
        ...prevVillaData,
        spaces: prevVillaData.spaces.map((space) =>
          space._id === selectedSpace._id ? response.data : space
        ),
      }));
      closeModal();
    } catch (error) {
      console.error('Error updating parking space:', error);
    }
  };

  if (!villaData) {
    return (
      <div>
        <h2>등록된 빌라가 없습니다.</h2>
        <button onClick={() => navigate('/main')}>메인 페이지로</button>
      </div>
    );
  }

  return (
    <div>
      <h2>{villaData.villaName}</h2>
      <p>주소: {villaData.address}</p>
      <p>빌라 ID: {villaData.villaId}</p>
      {villaData.spaces.map((space) => (
        <div key={space._id} onClick={() => space.type === 'PARKING' && openModal(space)}>
          {space.type === 'PARKING' ? '주차칸' : space.type}
        </div>
      ))}
      {modalOpen && selectedSpace && (
        <Modal isOpen={modalOpen} onClose={closeModal} isOccupied={selectedSpace.isOccupied} onSave={handleSubmit}>
          {selectedSpace.isOccupied ? (
            <>
              <h2>주차 정보</h2>
              <p>차종: {selectedSpace.vehicleName}</p>
              <p>차번호: {selectedSpace.vehicleNumber}</p>
              <p>연락처: {selectedSpace.contact}</p>
              <p>출차시간: {selectedSpace.exitTime}</p>
              <p>특이사항: {selectedSpace.notes}</p>
              <button onClick={handleSubmit}>출차하기</button>
            </>
          ) : (
            <>
              <h2>주차하기</h2>
              <input
                type="text"
                placeholder="출차시간"
                value={exitTime}
                onChange={(e) => setExitTime(e.target.value)}
              />
              <input
                type="text"
                placeholder="특이사항"
                value={notes}
                onChange={(e) => setNotes(e.target.value)}
              />
              <button onClick={handleSubmit}>주차하기</button>
            </>
          )}
        </Modal>
      )}
    </div>
  );
};

export default VillaDetail;
